INSERT INTO `consentimiento_detalle` (`cod_consentimiento`, `nombre`, `descripcion`, `objetivo`, `beneficio`, `riesgo`, `existe_alternativa`, `alternativa`, `decision`, `revocatoria`, `profesional_firma`) VALUES
('11. FT-PA-GI-HC-069', 'Venopuncion', 'Con previa técnica aséptica y con elementos de bioseguridad , se procede a puncionar una vena por vía periférica con una aguja de diferente calibre o una cánula portadora de un catéter de plástico flexible unido a una jeringa o un catéter con el fin de administrar líquidos, medicamentos u obtener una muestra de sangre para exámenes de laboratorio, teniendo claro que También puede presentarse la necesidad de puncionar varias veces antes de lograr una canalización o una adecuada muestra de laboratorio.', 'Canalizar una vía venosa periférica es una técnica invasiva que nos permite tener una vía permanente al sistema vascular del paciente. A través de esta vía podremos administrar líquidos, medicamentos u obtener una muestra de sangre.', '✓ Administrar medicamento por una vía de mayor absorción y rápida para realización del procedimiento.\r\n✓ Permite la administración grandes volúmenes de líquidos en caso de reponer pérdidas por el organismo.\r\n✓ Obtener una o varias muestras de sangre para dicho examen de laboratorio.\r\n✓ Los resultados del análisis de su sangre le permiten al médico contar con información acerca de su estado de salud para establecer un tratamiento en caso de requerirlo y/o brindarle recomendaciones para mantenerse saludable.', 'RIESGOS\r\n✓ Leve dolor y ardor en el sitio de inserción de la aguja, que ceden en cuanto ésta se retira.\r\n✓ Hematomas (morados) pequeños que mejorarán espontáneamente y/o con medidas locales como hielo inicialmente y paños de agua tibia en los días siguientes.\r\n✓ Náusea, vómito y desmayos antes o durante la punción de los cuales se recuperará rápidamente.\r\n✓ Sangrado más prolongado de lo esperado, (especialmente si toma anticoagulantes o aspirina). Para controlarlo debe hacerse presión suave en el sitio de punción con un algodón seco por unos 2 a 5 minutos.\r\n\r\nCOMPLICACIONES\r\n✓ Hematomas que abarcan una gran área del brazo puncionado.\r\n✓ Flebitis (inflamación de las paredes venosas)\r\n✓ Tromboflebitis (inflamatorio que hace que se forme un coágulo de sangre que bloquea una o más venas)\r\n✓ Intenso dolor y sensación tipo “corrientazo” y hormigueo que puede presentarse inmediatamente u horas después de la venopunción.\r\n✓ Infección en el sitio de punción que se manifiesta por enrojecimiento, calor, dolor y posible secreción en el sitio de ingreso de la aguja días después de la obtención de la muestra.\r\n✓ Infiltración (cuando liquido intravenosa se fuga para los tejidos circulantes)\r\n✓ Extravasación (lesión de la vena)\r\n✓ Embolia gaseosa\r\n✓ Obstrucción del flujo\r\n✓ Sobrecarga circulatoria\r\n✓ Reacción adversa al medicamento', 'No', 'No hay alternativas concretas.', 'Me permito manifestar que he recibido información clara y precisa, acerca del procedimiento que se me va a practicar y que aparece descrito en este mismo formato. El/la profesional que me atiende y cuyo nombre aparece en este formato me ha explicado de forma satisfactoria que es, como se realiza, el objetivo de practicármelo y los beneficios que razonablemente se pueden esperar del mismo. También me ha explicado los riesgos reales y potenciales, así como los riesgos con relación a mis circunstancias personales y las consecuencias que pudieran derivarse de mi negativa. También entiendo que estos tipos de riesgos inherentes al procedimiento pueden ocasionar desenlaces fatales.\r\n\r\nComprendo que, a pesar de la adecuada elección de la técnica y de su correcta realización, cabe la posibilidad que durante el procedimiento se evidencien hallazgos que ameriten realizar modificaciones con el fin de proporcionarme el tratamiento adecuado. Igualmente reconozco que no se me ha garantizado los resultados que se preparan de la intervención o procedimiento, por tratarse de una actividad de medios y no de resultados, teniendo en cuenta que se hará uso de todos los elementos técnico científicos disponibles y demás parámetros de calidad para la ejecución de la LEY 911 DE 2004.\r\n\r\nReconozco que se me ha indicado la necesidad de advertir de mis posibles alergias medicamentosas, alteraciones de la coagulación, medicaciones actuales o cualquier otra circunstancia personal que pueda aumentar la frecuencia o la gravedad de los riesgos o complicaciones.\r\n\r\nAutorizo a GASTROQUIRURGICA SAS y a sus enfermeras administrar líquidos, medicamentos u obtener una muestra de sangre para exámenes de laboratorio durante la atención.\r\n\r\nDeclaro que se me han dado todas las facilidades para hacer preguntas y he recibido respuesta a todas ellas, comprendiendo todo a cabalidad y disponiendo de toda la información necesaria para dar mi consentimiento informado. Comprendo que la decisión que tomo es libre y voluntaria, que puedo retirar este consentimiento cuando lo desee, en cuyo caso deberé informar por escrito el cambio de decisión al equipo de salud de la institución.\r\n\r\nEn consecuencia, manifiesto que he decidido lo siguiente en relación con el tratamiento o procedimiento propuesto y avalo mi decisión con mi firma:', 'Por medio de la presente declaro en pleno y normal uso de mis facultades mentales que, sin que exista presión externa alguna para la toma de mi decisión la cual es libre y conociendo los alcances de la misma y ejerciendo el derecho a la autonomía que tengo como paciente y/o representante legal, REVOCO la autorización entregada a la Clínica Gastroquirúrgica SAS. para mi estudio diagnostico y/o procedimiento, que me fue informado anteriormente sobre el propósito de la atención, las ventajas, complicaciones, molestias, riesgos, y haciéndome responsable de las consecuencias que puedan derivarse de esta decisión y eximiendo al médico tratante, al equipo de salud y a la institución de toda\r\nresponsabilidad.', 'PERSONAL DE ENFERMERIA'),
('4423432423', 'VENOPUNCION', 'Con previa técnica aséptica y con elementos de bioseguridad , se procede a puncionar una vena por vía periférica con una aguja de diferente calibre o una cánula portadora de un catéter de plástico flexible unido a una jeringa o un catéter con el fin de administrar líquidos, medicamentos u obtener una muestra de sangre para exámenes de laboratorio, teniendo claro que También puede presentarse la necesidad de puncionar varias veces antes de lograr una canalización o una adecuada muestra de laboratorio.', 'Canalizar una vía venosa periférica es una técnica invasiva que nos permite tener una vía permanente al sistema vascular del paciente. A través de esta vía podremos administrar líquidos, medicamentos u obtener una muestra de sangre.', '	Administrar medicamento por una vía de mayor absorción y rápida para realización del procedimiento.\r\n	Permite la administración grandes volúmenes de líquidos en caso de reponer pérdidas por el organismo.\r\n	Obtener una o varias muestras de sangre para dicho examen de laboratorio.\r\n	Los resultados del análisis de su sangre le permiten al médico contar con información acerca de su estado de salud para establecer un tratamiento en caso de requerirlo y/o brindarle recomendaciones para mantenerse saludable.', 'RIESGOS\r\n	Leve dolor y ardor en el sitio de inserción de la aguja, que ceden en cuanto ésta se retira.\r\n	Hematomas (morados) pequeños que mejorarán espontáneamente y/o con medidas locales como hielo inicialmente y paños de agua tibia en los días siguientes.\r\n	Náusea, vómito y desmayos antes o durante la punción de los cuales se recuperará rápidamente.\r\n	Sangrado más prolongado de lo esperado, (especialmente si toma anticoagulantes o aspirina). Para controlarlo debe hacerse presión suave en el sitio de punción con un algodón seco por unos 2 a 5 minutos.\r\n\r\nCOMPLICACIONES\r\n	Hematomas que abarcan una gran área del brazo puncionado.\r\n	Flebitis (inflamación de las paredes venos